import Link from 'next/link';

const Nav = () => (
  <div id="navwrapper">
    <Link href="/">
      <a>J & M Transmission</a>
    </Link>
    <div id="linkwrapper">
      <Link href="/">
        <a>Contact Us</a>
      </Link>
      <Link href="/">
        <a>About</a>
      </Link>
    </div>

    <style jsx>{`
      #navwrapper {
        float: left;
        width: 100%;
        background: rgba(89, 89, 89, .8);
        margin: 0;
      }
      #linkwrapper {
        float: right;
      }
      a {
        float: left;
        padding: 22px;
        text-decoration: none;
        color: white;
        font: 18px 'Rubik';
        transition: all ease .4s;
      }
      a:hover {
        background: rgba(89,89,89,.4);
        color: #FF6161;
      }

/* This is the mobile version styling of the Navigation-Bar */

      @media only screen and (max-device-width: 480px) {
        #linkwrapper {
          display: none;
        }
      }
      `}</style>
  </div>
);

export default Nav;
